import { useState, useEffect, useRef, useMemo, React } from 'react';
import Button from '@material-ui/core/Button';
import { BarChart, Bar, CartesianGrid, XAxis, YAxis, Tooltip, Legend } from 'recharts';
import { Typography } from '@material-ui/core';

function GraphAll() {
    const data = [{country: 'China', total_vaccine: 366910000, infection: 102571},
    {country: 'USA', total_vaccine: 266596486.0, infection: 32557444},
    {country: 'India', total_vaccine: 178361846, infection: 21077410},
    {country: 'UK', total_vaccine: 54797640, infection: 4441644},
    {country: 'Brazil', total_vaccine: 50308106, infection: 14930183},
    {country: 'Germany', total_vaccine: 38646171, infection: 3484755},
    {country: 'France', total_vaccine: 27455748, infection: 32557444},
    {country: 'Italy', total_vaccine: 25948925, infection: 4070400},
    {country: 'Turkey', total_vaccine: 25402277, infection: 4955594},
    {country: 'Russia', total_vaccine: 22782931, infection: 4792354}];

    return (
    <div>
        <BarChart width={800} height={400} data={data}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="country" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar type="monotone" dataKey="total_vaccine" stroke="#8884d8" />
            <Bar type="monotone" dataKey="infection" stroke="#82ca9d" />
        </BarChart>
    </div>
    )
}

export default GraphAll;
